class Solution:
    def shortestPalindrome(self, s: str) -> str:
        if s == s[::-1]:
            return s
        rb_max = 0
        len_s = len(s)
        for i in range(len_s):
            for r in (1, 2):
                if (i < len_s - r) and s[i] == s[i + r]:
                    # len_p, s_p = get_len_str(s, i, i+r)
                    lb = i
                    rb = i + r
                    while lb > 0 and rb < len(s) - 1:
                        if s[lb - 1] == s[rb + 1]:
                            lb -= 1
                            rb += 1
                        else:
                            break

                    if lb == 0 and (rb > rb_max):
                        rb_max = rb

        return s[rb_max + 1:][::-1] + s

    def find_p(self, s: str):
        for i in range(len(s)-1,-1,-1):
            print(i)

        max_i = 0
        for i in range(len(s)):
            if s[:i+1] == s[:i+1][::-1]:
                max_i = i
                # print(max_i)
        return s[max_i+1:][::-1] + s


